    public class VehicleDealerManager : Script
    {
        public static string DealerBookFrontPage = "data:image/png;base64,";
        public static ColShape dealerEntrance;
        public static ColShape dealerGarageDoor;
        public static ColShape dealerExitPoint;
        public VehicleDealerManager()
        {
            API.onClientEventTrigger += OnClientEventTriggerAsync;
            API.onEntityEnterColShape += OnEntityEnterColShape;
            API.onEntityExitColShape += OnEntityExitColShape;
            API.onPlayerExitVehicle += OnPlayerExitVehicle;
            API.onResourceStart += OnResourceStart;
            API.onVehicleWindowSmash += OnVehicleWindowSmash;
        }

        private void OnVehicleWindowSmash(NetHandle entity, int index)
        {
            Vehicle veh = Vehicle.VehicleData[entity];
            if (veh.IsDealerVehicle)
            {
                if (Player.PlayerData.Values.FirstOrDefault(p => p.Id == veh.OwnerId).InEvent == PlayerEvent.TestDrive)
                {
                    if (veh.TestDriveWindowSmashWarnings == 0)
                    {
                        API.SendCloseMessage(veh.Entity, 15f, "Burt Macklin says: You've smashed the fucking window! Return to the dealership now or I will be calling the police.");
                        veh.TestDriveWindowSmashWarnings++;
                        return;
                    }
                    else
                    {
                        //Call cops
                    }
                }
            }
        }

        private void OnPlayerExitVehicle(Client player, NetHandle vehicle)
        {
            if (player.dimension == 0)
            {

                if (API.doesEntityExist(vehicle))
                {
                    Vehicle veh = Vehicle.VehicleData[vehicle];

                    if (veh.IsDealerVehicle && veh.OwnerId == Player.PlayerData[player].Id)
                    {
                        Task.Run(async () =>
                        {
                            veh.DealershipEmployee.ClimbOver(veh.Entity);
                            API.setVehicleLocked(vehicle, true);
                            await Task.Delay(4000);
                            veh.DealershipEmployee.DriveTo(veh.Entity, -237.7964f, 6185.76f, 31.49083f, 25f);
                        });
                    }
                }
            }
        }

        private void OnEntityExitColShape(ColShape colshape, NetHandle entity)
        {
            if (colshape == dealerEntrance)
            {
                if (API.getEntityType(entity) == EntityType.Player)
                {
                    API.triggerClientEvent(API.getPlayerFromHandle(entity), "onPlayerLeaveDealer");
                }
            }
        }

        private void OnResourceStart()
        {
            dealerEntrance = API.createCylinderColShape(new Vector3(-248.1604f, 6212.266f, 31f), 2, 10);
            dealerGarageDoor = API.createCylinderColShape(new Vector3(-237.7964, 6185.76, 31.49083), 10, 10);
            dealerExitPoint = API.createCylinderColShape(new Vector3(-31.64906, -1091.85, 26.42229), 4, 7);
            GrandTheftMultiplayer.Server.Elements.Object shutter = API.createObject(-1081024910, new Vector3(-29.4736137, -1086.58557, 25.5614491), new Vector3(0, 0, -19.98493));
            GrandTheftMultiplayer.Server.Elements.Object window1 = API.createObject(1299409410, new Vector3(-58.780899, -1100.3551, 27.4051323), new Vector3(-0, 0, 121.15329));
            GrandTheftMultiplayer.Server.Elements.Object window2 = API.createObject(1299409410, new Vector3(-59.7389984, -1098.84399, 27.4051094), new Vector3(2.79396772e-09, 0, -56.4076195));
            GrandTheftMultiplayer.Server.Elements.Object window3 = API.createObject(1299409410, new Vector3(-60.7037125, -1097.32324, 27.4051075), new Vector3(0, 0, -58.4546356));

            window1.invincible = true;
            window2.invincible = true;
            window3.invincible = true;
        }

        private void OnEntityEnterColShape(ColShape colshape, NetHandle entity)
        {
            if (colshape == dealerEntrance)
            {
                if (API.getEntityType(entity) == EntityType.Player)
                {
                    Player p = Player.PlayerData[API.getPlayerFromHandle(entity)];
                    if (p.InEvent == PlayerEvent.VehicleDealership) return;
                    API.triggerClientEvent(API.getPlayerFromHandle(entity), "onPlayerEnterDealer", ((char)p.MasterAccount.KeyInteract).ToString(), p.MasterAccount.KeyInteract);
                }
            }
            else if(colshape == dealerGarageDoor)
            {
                if(API.getEntityType(entity) == EntityType.Vehicle)
                {
                    Vehicle veh = Vehicle.VehicleData[entity];
                    if (veh.IsDealerVehicle)
                    {
                        Player p;
                        if (Player.PlayerData.Keys.Where(pl => pl.vehicle == veh.Entity).FirstOrDefault() == null)
                        {
                            p = PlayerRepository.GetPlayerDataById(veh.OwnerId);

                            if (veh.TestDriveDamageWarnings > 1 || veh.TestDriveWindowSmashWarnings >= 1 || veh.TestDriveSpeedingWarnings > 6)
                            {
                                if (veh.TestDriveSpeedingWarnings >= 12 || veh.TestDriveDamageWarnings == 4) p.TestDriveBan = true;
                            }
                            else
                            {
                                BankAccount govAccount = BankRepository.GetAccountById(2);
                                long value = (long)Math.Round(veh.Entity.Price() * 0.2f);

                                govAccount.Balance -= value;
                                p.Money += value;
                                CashLogRepository.AddNew(new CashLog(2, p.Id, value, MoneyTransferMethod.VehicleDepositRefund));
                                BankRepository.UpdateAsync(govAccount);
                            }

                            veh.Entity.Delete();
                            API.deleteEntity(veh.DealershipEmployee);
                        }
                        else
                        {
                            p = Player.PlayerData.Values.Where(pl => pl.Id == veh.OwnerId).FirstOrDefault();

                            if (veh.TestDriveDamageWarnings > 1 || veh.TestDriveWindowSmashWarnings >= 1 || veh.TestDriveSpeedingWarnings > 6)
                            {
                                if (veh.TestDriveSpeedingWarnings >= 12 || veh.TestDriveDamageWarnings == 4) {
                                    p.TestDriveBan = true;
                                    API.SendCloseMessage(p.Client, 15f, "Burt Macklin says: You can forget about taking a test drive with Helmuts again! You're lucky we'll even let you inside.");
                                }
                                else
                                {
                                    API.SendCloseMessage(p.Client, 15f, "Burt Macklin says: That was some pretty shit driving out there today, you won't be getting your deposit after that display.");
                                }
                                API.SendErrorNotification(p.Client, "Your deposit of " + (veh.Entity.Price() * 0.2f).ToString("C0") + " has been retained for damages");
                            }
                            else
                            {
                                BankAccount govAccount = BankRepository.GetAccountById(2);
                                long value = (long)Math.Round(veh.Entity.Price() * 0.2f);

                                govAccount.Balance -= value;
                                p.Money += value;
                                CashLogRepository.AddNew(new CashLog(2, p.Id, value, MoneyTransferMethod.VehicleDepositRefund));
                                BankRepository.UpdateAsync(govAccount);

                                API.SendCloseMessage(p.Client, 15f, "Burt Macklin says: Nice smooth drive! So, what did you think of her? Lets head back inside.");
                                API.SendSuccessNotification(p.Client, $"Your deposit of {(veh.Entity.Price() * 0.2f).ToString("C0")} has been returned");

                                Task.Run(async () =>
                                {
                                    await Task.Delay(2500);
                                    veh.Entity.position = new Vector3(-38.87646, -1099.738, 26.00406);
                                    veh.Entity.rotation = new Vector3(0, 0, -24.27315);
                                    veh.Entity.dimension = Globals.GetPlayerID(p.Client) + 1;

                                    veh.DealershipEmployee.position = new Vector3(-38.03681, -1108.496, 26.43781);
                                    veh.DealershipEmployee.rotation = new Vector3(0, 0, -15.66);


                                    p.Client.position = new Vector3(-38.03681, -1107.996, 26.43781);
                                    p.Client.rotation = new Vector3(0, 0, -15.66981);

                                    p.Client.dimension = Globals.GetPlayerID(p.Client) + 1;
                                    p.InEvent = PlayerEvent.VehicleDealership;

                                    API.triggerClientEvent(p.Client, "showPreviewOptions", p.TestDriveBan);
                                    veh.DealershipEmployee.MoveTo(-32.28473f, -1098.316f, 26.42234f, 2, 9);
                                    await Task.Delay(4000);
                                    veh.DealershipEmployee.TurnToPosition(p.Client.position);
                                   
                                }); 
                            }
                        }

                        PlayerRepository.UpdateAsync(p);
                    }                        
                }
            }
            else if(colshape == dealerExitPoint)
            {
                if(API.getEntityType(entity) == EntityType.Player)
                {
                    Client player = API.getPlayerFromHandle(entity);
                    if(player.isInVehicle)
                    {
                        GrandTheftMultiplayer.Server.Elements.Vehicle handle = player.vehicle;
                        Vehicle veh = Vehicle.VehicleData[player.vehicle];
                        player.FadeOutIn(400, 1000);
                        Task.Run(async () =>
                        {
                            await Task.Delay(600);
                            if (Player.PlayerData[player].Id == veh.OwnerId && veh.IsDealerVehicle)
                            {
                                veh.Entity.movePosition(new Vector3(-239.193, 6230.888, 31.01301), 50);
                                veh.Entity.moveRotation(new Vector3(0, 0, 68.00964), 50);
                                API.deleteEntity(veh.DealershipEmployee);
                               
                                veh.Entity.dimension = 0;
                                player.dimension = 0;
                                veh.DealershipEmployee = API.createPed(PedHash.AndreasCutscene, new Vector3(-239.193, 6236.888, 31.01301), 71.27095f, 0);
                                veh.DealershipEmployee.EnterVehicle(veh.Entity, 0, 5, 16);
                                player.ClearChat();
                            }
                            API.triggerClientEvent(player, "closeDealerBook");
                        });
                    }
                }
            }
        }

        private async void OnClientEventTriggerAsync(Client sender, string eventName, params object[] arguments)
        {
            if (eventName == "InitiateDealer")
            {
                sender.FadeOutIn(300, 1500);
                sender.position = new Vector3(-38.03681, -1107.996, 26.43781);
                sender.rotation = new Vector3(0, 0, -15.66981);

                sender.dimension = Globals.GetPlayerID(sender) + 1;
                await InitVehicleDealer(sender);
                Player.PlayerData[sender].InEvent = PlayerEvent.VehicleDealership;
                API.sendNativeToPlayer(sender, Hash.SET_PED_CAN_SMASH_GLASS, sender, false, false);
            }
            else if (eventName == "ExitPreview")
            {
                Player p = Player.PlayerData[sender];
                p.InEvent = PlayerEvent.None;
                sender.position = new Vector3(-248.1604f, 6212.266f, 31);
                sender.dimension = 0;

                Vehicle dealVeh = Vehicle.VehicleData.Values.Where(v => v.OwnerId == p.Id && v.IsDealerVehicle).FirstOrDefault();
                if (dealVeh != null)
                {
                    dealVeh.DealershipEmployee.delete();
                    dealVeh.Entity.Delete();
                }
                API.sendNativeToPlayer(sender, Hash.SET_PED_CAN_SMASH_GLASS, sender, true, true);

            }
            else if (eventName == "previewVehicleClicked")
            {
                Player p = Player.PlayerData[sender];
                VehicleHash model = DealershipVehicle.VehiclesInCatalog.FirstOrDefault(v => v.Id == int.Parse(arguments[0].ToString())).Model;

                Vehicle newDealerVehicle = new Vehicle()
                {
                    OwnerId = p.Id,
                    Color1 = "0",
                    Color2 = "0",
                    LicensePlate = "HELMUTS",
                    Entity = API.createVehicle(model, new Vector3(-38.87646, -1099.738, 26.00406), new Vector3(0, 0, -24.27315), 0, 0, Globals.GetPlayerID(sender) + 1),
                    Model = (int)model,
                    IsEngineOn = true,
                    IsDealerVehicle = true,
                    Fuel = 100,
                    IsAdminVehicle = false,
                    DealershipEmployee = API.createPed(PedHash.AndreasCutscene, new Vector3(-30.32774, -1089.042, 26.42208), 71.27095f, Globals.GetPlayerID(sender) + 1),
                    TestDriveDamageWarnings = 0,
                    TestDriveWindowSmashWarnings = 0,
                    TestDriveSpeedingWarnings = 0
                };

                newDealerVehicle.Entity.CreateID();

                sender.dimension = p.RealId + 1;

                newDealerVehicle.Entity.numberPlate = "HELMUTS";
                newDealerVehicle.Entity.engineStatus = false;
                newDealerVehicle.Entity.dimension = Globals.GetPlayerID(sender) + 1;

                Vehicle.VehicleData.Add(newDealerVehicle.Entity, newDealerVehicle);

                newDealerVehicle.DealershipEmployee.MoveTo(-32.28473f, -1098.316f, 26.42234f, 2, 9);
                newDealerVehicle.DealershipEmployee.LookAtEntity(sender, 120);
                API.triggerClientEvent(sender, "showPreviewOptions");

                p.PrimaryPhone?.Hide(sender);

                await Task.Run(async () =>
                {
                    await Task.Delay(7500);
                    newDealerVehicle.DealershipEmployee.TurnToPosition(sender.position);
                    if (!p.TestDriveBan)
                        API.SendCloseMessage(newDealerVehicle.DealershipEmployee, 15.0f, "Burt Macklin says: Great choice, wanna' take her for a spin?");
                    else
                        API.SendCloseMessage(newDealerVehicle.DealershipEmployee, 15f, "Burt Macklin says: It's nice you finally chose a vehicle, are you going to buy it or what?");
                });                
            }
            else if (eventName == "DealerTestDrive")
            {
                Player p = Player.PlayerData[sender];
                if (p.TestDriveBan)
                {
                    API.SendCloseMessage(sender, 15f, "Burt Macklin says: There is no way I am getting in a car with you again, " + p.Username.Split('_')[0] + ". You are banned from test driving with us.");
                    return;
                }

                Vehicle dealVeh =
                    Vehicle.VehicleData.Values.FirstOrDefault(v => v.OwnerId == p.Id && v.IsDealerVehicle);
                if (!sender.isInVehicle) sender.EnterVehicle(dealVeh.Entity, -1);
                dealVeh.DealershipEmployee.EnterVehicle(dealVeh.Entity, 0, 16);

                if (p.InEvent == PlayerEvent.TestDrive) return;

                p.InEvent = PlayerEvent.TestDrive;

                await Task.Run(async() =>
                {
                    while (! await dealVeh.DealershipEmployee.IsInVehicle(sender))
                    {
                        await Task.Delay(1000);
                    }
                    await Task.Delay(4500);
                    if (p.InEvent != PlayerEvent.TestDrive) return;
                    API.sendChatMessageToPlayer(p.Client, "Burt Macklin says: Before we head out, I need to make a few points clear.");
                    await Task.Delay(3500);
                    if (p.InEvent != PlayerEvent.TestDrive) return;
                    API.sendChatMessageToPlayer(p.Client, "Burt Macklin says: You'll need to put a deposit down in order to test drive, totalling 20% of the vehicles price.");
                    await Task.Delay(4000);
                    if (p.InEvent != PlayerEvent.TestDrive) return;
                    API.sendChatMessageToPlayer(p.Client, "Burt Macklin says: Any damage to the vehicle will result in the loss of your deposit.");
                    await Task.Delay(5000);
                    if (p.InEvent != PlayerEvent.TestDrive) return;
                    API.sendChatMessageToPlayer(p.Client, "Burt Macklin says: Although I doubt you will, if we are involved any police alteraction during the test drive...");
                    API.sendChatMessageToPlayer(p.Client, "...then you will be banned from using this facility again. Understood?");
                    await Task.Delay(1500);
                    if (p.InEvent != PlayerEvent.TestDrive) return;
                    API.ShowPopupPrompt(sender, "TestDriveDeposit", "Take the test drive?", "Do you confirm you understand the test drive rules and want to pay the deposit of " + (dealVeh.Entity.Price() * 0.2f).ToString("C0") + "?");
                });
            }
            else if (eventName == "TestDriveDeposit")
            {
                if ((int)arguments[0] == 1)
                {
                    Player p = Player.PlayerData[sender];
                    p.SelectedCardAccount = null;
                    p.SelectedCash = null;

                    p.AwaitingInventorySelection = InventoryType.Money;

                    InventoryManager.UpdatePlayerInventory(p);
                }
            }
            else if (eventName == "SetDealerVehicleColor")
            {
                Vehicle dealVeh = Vehicle.VehicleData.FirstOrDefault(v => v.Value.OwnerId == Player.PlayerData[sender].Id && v.Value.IsDealerVehicle).Value;

                string hex = arguments[1].ToString().TrimStart('#');
                int red = int.Parse(hex.Substring(0, 2), NumberStyles.AllowHexSpecifier);
                int green = int.Parse(hex.Substring(2, 2), NumberStyles.AllowHexSpecifier);
                int blue = int.Parse(hex.Substring(4, 2), NumberStyles.AllowHexSpecifier);
                if ((int)arguments[0] == 0)
                {
                    dealVeh.Entity.customPrimaryColor = new Color(red, green, blue);
                    dealVeh.Color1 = hex;
                }
                else
                {
                    dealVeh.Color2 = hex;
                    dealVeh.Entity.customSecondaryColor = new Color(red, green, blue);
                }
            }
            else if (eventName == "OpenDealerVehicleDoors")
            {
                Vehicle dealVeh = Vehicle.VehicleData.Where(v => v.Value.OwnerId == Player.PlayerData[sender].Id && v.Value.IsDealerVehicle).First().Value;
                for (int i = 0; i < API.getVehicleMaxOccupants((VehicleHash)dealVeh.Model); i++)
                    if (dealVeh.Entity.isDoorOpen(i))
                        dealVeh.Entity.closeDoor(i);
                    else
                        dealVeh.Entity.openDoor(i);
            }
            else if (eventName == "OpenDealerVehicleHood")
            {
                Vehicle dealVeh = Vehicle.VehicleData.Where(v => v.Value.OwnerId == Player.PlayerData[sender].Id && v.Value.IsDealerVehicle).First().Value;
                if (dealVeh.Entity.isDoorOpen(4))
                    dealVeh.Entity.closeDoor(4);
                else
                    dealVeh.Entity.openDoor(4);
            }
            else if (eventName == "OpenDealerVehicleTrunk")
            {
                Vehicle dealVeh = Vehicle.VehicleData.Where(v => v.Value.OwnerId == Player.PlayerData[sender].Id && v.Value.IsDealerVehicle).First().Value;
                if (dealVeh.Entity.isDoorOpen(5))
                    dealVeh.Entity.closeDoor(5);
                else
                    dealVeh.Entity.openDoor(5);
            }
            else if (eventName == "PressDealerVehicleHorn")
            {
                Vehicle dealVeh = Vehicle.VehicleData.Where(v => v.Value.OwnerId == Player.PlayerData[sender].Id && v.Value.IsDealerVehicle).First().Value;
                API.sendNativeToAllPlayers(Hash.START_VEHICLE_HORN, dealVeh.Entity, 0, 30);
            }
            else if (eventName == "PurchaseDealerVehicle")
            {
                Player p = Player.PlayerData[sender];
                Vehicle dealVeh = Vehicle.VehicleData.Where(v => v.Value.OwnerId == p.Id && v.Value.IsDealerVehicle).First().Value;

                API.ShowPopupPrompt(sender, "confirmDealerPurchase", "Purchase this " + dealVeh.Entity.displayName, "Are you sure you want to purchase this " + dealVeh.Entity.displayName + " for " +
                    dealVeh.Entity.Price().ToString("C0") + "?");
            }
            else if (eventName == "confirmDealerPurchase")
            {
                if ((int)arguments[0] == 1)
                {
                    Player p = Player.PlayerData[sender];
                    p.SelectedCardAccount = null;
                    p.SelectedCash = null;

                    p.AwaitingInventorySelection = InventoryType.Money;

                    InventoryManager.UpdatePlayerInventory(p);
                }
            }
            if (eventName == "OnPaymentPinEntered")
            {
                Player p = Player.PlayerData[sender];
                if (p.InEvent == PlayerEvent.VehicleDealership || p.InEvent == PlayerEvent.TestDrive)
                {
                    if (p.SelectedCardAccount.Locked)
                    {
                        API.SendErrorNotification(sender, "The account assigned to this card is currently locked, please try again.", 7);
                        InventoryManager.UpdatePlayerInventory(p);
                        return;
                    }
                    if (p.SelectedCardAccount.Pin == arguments[0].ToString())
                    {
                        API.triggerClientEvent(sender, "closePaymentUI");
                        Vehicle dealVeh =
                            Vehicle.VehicleData.Values.FirstOrDefault(v => v.OwnerId == p.Id && v.IsDealerVehicle);

                        long value = p.InEvent == PlayerEvent.TestDrive ? (long)Math.Round(dealVeh.Entity.Price() * 0.2f) : dealVeh.Entity.Price();

                        if (p.SelectedCardAccount.Balance >= value)
                        {
                            BankAccount govAccount = BankRepository.GetAccountById(2);
                            if (p.InEvent == PlayerEvent.TestDrive)
                            {
                                govAccount.Balance += value;
                                p.SelectedCardAccount.Balance -= value;

                                API.shared.sendChatMessageToPlayer(p.Client, "Burt Macklin says: Guess we are all set then, lets head out.");
                                dealVeh.IsEngineOn = true;
                                dealVeh.Entity.engineStatus = true;
                                API.shared.setVehicleEngineStatus(dealVeh.Entity.handle, true);

                                for (int i = 0; i < 7; i++)
                                    dealVeh.Entity.closeDoor(i);

                                CashLogRepository.AddNew(new CashLog(p.SelectedCardAccount.Id, 2, value, MoneyTransferMethod.VehicleDepositBank));
                                BankRepository.UpdateAsync(govAccount);
                                BankRepository.UpdateAsync(p.SelectedCardAccount);
                                p.SelectedCardAccount = null;
                                p.AwaitingInventorySelection = null;
                            }
                            else
                            {
                                await CreateNewPlayerVehicle(p, dealVeh, false);
                            }
                        }
                        else API.SendErrorNotification(sender, "Insufficient funds", 10);
                    }
                    else
                    {
                        p.SelectedCardAccount.FailedPinAttempts = 3 - (int)arguments[1];

                        if (p.SelectedCardAccount.FailedPinAttempts == 3)
                        {
                            p.SelectedCardAccount.Locked = true;
                            p.SelectedCardAccount.LockedType = BankAccountLockedType.FailedPin;
                        }
                        BankRepository.UpdateAsync(p.SelectedCardAccount);
                    }
                }
            }
        }

        public static void DealershipPaymentCard(Player p, Inventory inv)
        {
            p.SelectedCardAccount = BankRepository.GetAccountByCardNumber(long.Parse(inv.Value));

            InventoryManager.HidePlayerInventory(p, true);
            API.shared.triggerClientEvent(p.Client, "PaymentEnterPin", 3 - p.SelectedCardAccount.FailedPinAttempts);
        }

        public static async void DealershipPaymentCash(Player p, Inventory inv)
        {
            Vehicle dealVeh = Vehicle.VehicleData.Values.Where(v => v.OwnerId == p.Id && v.IsDealerVehicle).First();

            long value = p.InEvent == PlayerEvent.TestDrive ? (long)Math.Round(dealVeh.Entity.Price() * 0.2f) : dealVeh.Entity.Price();
            if (long.Parse(inv.Value) >= value)
            {

                if (p.InEvent == PlayerEvent.TestDrive)
                {
                    BankAccount govAccount = BankRepository.GetAccountById(2);

                    govAccount.Balance += value;
                    inv.Value = (long.Parse(inv.Value) - value).ToString();

                    API.shared.sendChatMessageToPlayer(p.Client, "Burt Macklin says: Guess we are all set then, lets head out.");
                    dealVeh.IsEngineOn = true;
                    dealVeh.Entity.engineStatus = true;
                    API.shared.setVehicleEngineStatus(dealVeh.Entity.handle, true);

                    for (int i = 0; i < 7; i++)
                        dealVeh.Entity.closeDoor(i);

                    CashLogRepository.AddNew(new CashLog(p.Id, 2, value, MoneyTransferMethod.VehicleDepositCash));
                    BankRepository.UpdateAsync(govAccount);
                }
                else
                {
                    p.SelectedCash = inv;
                    await CreateNewPlayerVehicle(p, dealVeh, true);

                }
                if (inv.Value == "0")
                {
                    p.Inventory.Remove(inv);
                    InventoryRepository.RemoveInventoryItem(inv);
                }
                else
                {
                    InventoryRepository.UpdateAsync(inv);
                }
            }
            else
            {
                API.shared.SendErrorNotification(p.Client, "Insufficient funds.");
                API.shared.SendInfoNotification(p.Client, "Select new payment method:");
                InventoryManager.UpdatePlayerInventory(p);
            }
        }

        private async static Task CreateNewPlayerVehicle(Player p, Vehicle dealVeh, bool cashPayment)
        {
            await Task.Run(async () =>
            {
                Inventory keyInv = new Inventory()
                {
                    Type = InventoryType.VehicleKey,
                    Quantity = 1,
                    Value = "",
                    OwnerId = p.Id,
                    Name = dealVeh.Entity.displayName + " Key",
                };
                if(!keyInv.AddToPlayer(p, true)) { API.shared.SendWarningNotification(p.Client, String.Format("You don't have enough space for your new {0}'s key", dealVeh.Entity.displayName)); return; } 

                dealVeh.IsDealerVehicle = false;
                bool licenseNotUnique = true;
                while (licenseNotUnique)
                {
                    string license = Globals.GenerateLicensePlate("0AAA000");
                    if ((await VehicleRepository.GetAllVehiclesByLicensePlate(license)).Count == 0)
                    {
                        dealVeh.LicensePlate = Globals.GenerateLicensePlate("0AAA000");
                        licenseNotUnique = false;
                    }
                }
                bool keyNotUnique = true;
                while (keyNotUnique)
                {
                    string key = Globals.GetUniqueString();
                    if (InventoryRepository.GetInventoryItemOfTypeByValue(InventoryType.VehicleKey, key) == null)
                    {
                        dealVeh.Key = Globals.GetUniqueString();
                        keyInv.Value = dealVeh.Key;
                        keyNotUnique = false;
                    }
                }

                
                dealVeh.Dimension = 0;
                dealVeh.FactionId = 0;
                dealVeh.Health = 1000;
                dealVeh.Locked = false;
                dealVeh.IsEngineOn = false;
                dealVeh.KeyInIgnition = false;
                dealVeh.LicensePlateStyle = 0;
                dealVeh.Fuel = 100;
                dealVeh.DoorData = new int[6] { 0, 0, 0, 0, 0, 0 };
                dealVeh.TyresData = new int[8] { 0, 0, 0, 0, 0, 0, 0, 0 };
                dealVeh.WindowData = new int[6] { 0, 0, 0, 0, 0, 0 };

                dealVeh.Entity.repair();
                dealVeh.Entity.numberPlate = dealVeh.LicensePlate;
                dealVeh.Entity.numberPlateStyle = 0;
                dealVeh.IsAdminVehicle = false;
                dealVeh.Entity.dimension = 0;
                dealVeh.Entity.engineStatus = false;
                API.shared.setVehicleLocked(dealVeh.Entity, false);
                dealVeh.RotZ = -138.2236;
                dealVeh.SavePosition = new Vector3(-208.4852, 6203.116, 31.48922);

                dealVeh.Entity.position = new Vector3(-208.4852, 6203.116, 31.48922);
                dealVeh.Entity.rotation = new Vector3(0, 0, -138.2236);

                BankAccount govAccount = BankRepository.GetAccountById(2);
                long value = dealVeh.Entity.Price();

                govAccount.Balance += (long)(value * 0.11);
                if (cashPayment)
                {
                    p.SelectedCash.Value = (long.Parse(p.SelectedCash.Value) - value).ToString();
                    if (p.SelectedCash.Value == "0") { p.Inventory.Remove(p.SelectedCash); InventoryRepository.RemoveInventoryItem(p.SelectedCash); }
                    else InventoryRepository.UpdateAsync(p.SelectedCash);
                }
                else
                {
                    p.SelectedCardAccount.Balance -= value;
                    BankRepository.UpdateAsync(p.SelectedCardAccount);
                }

                CashLogRepository.AddNew(new CashLog(cashPayment ? p.Id : p.SelectedCardAccount.Id, 2, value, cashPayment ? MoneyTransferMethod.VehiclePurchaseCash : MoneyTransferMethod.VehiclePurchaseBank));
                BankRepository.UpdateAsync(govAccount);

                VehicleRepository.AddNewVehicle(dealVeh);
                InventoryRepository.AddNewInventoryItem(keyInv);
                PlayerRepository.UpdateAsync(p);
                Vehicle.VehicleData[dealVeh.Entity] = dealVeh;
                dealVeh.TrunkItems = new List<Inventory>();

                p.SelectedCash = null;
                p.SelectedCardAccount = null;
                p.InEvent = PlayerEvent.None;

                await Task.Run(async () =>
                {
                    await Task.Delay(300);
                    p.Inventory = InventoryRepository.GetInventoryByOwnerId(p.Id);
                    API.shared.setPlayerIntoVehicle(p.Client, dealVeh.Entity, -1);
                    API.shared.triggerClientEvent(p.Client, "closeDealerBook");
                    API.shared.sendNativeToPlayer(p.Client, Hash.SET_PED_CAN_SMASH_GLASS, p.Client, true, true);
                });
            });
        }
       
        public async Task InitVehicleDealer(Client player)
        {
            await Task.Run(async () =>
            {
                Player p = Player.PlayerData[player];
                API.triggerClientEvent(player, "InitDealer");
                await Task.Delay(1000 + player.ping);

                var dealerList =  DealershipVehicle.VehiclesInCatalog.OrderBy(v => v.ModelName).Select(v => new
                {
                    v.Id,
                    v.Name,
                    v.Price,
                    v.MaxAcceleration,
                    v.MaxTraction,
                    v.MaxOccupants,
                    v.MaxBraking,
                    v.MaxSpeed,
                    v.Image
                });

                API.triggerClientEvent(player, "dealerFrontPage", dealerList.Count(), DealerBookFrontPage, ((char)p.MasterAccount.KeyCursor).ToString());
                await Task.Delay(800 + player.ping);
                foreach (var veh in dealerList)
                {
                    await Task.Delay(85);
                    API.triggerClientEvent(player, "addDealerPage",
                        JsonConvert.SerializeObject(veh));

                }
                API.triggerClientEvent(player, "LoadDealerImages");
                p.VehicleDealerClass = "Sedan";
            });
        }
    }
